import React, { useEffect, useState } from 'react';
import banner from '../../Images/top_banner.jpg';
import { Button} from 'react-bootstrap';
import Service from '../Service/Service';
import './Home.css';

const Home = () => {

    const [services, setServices] = useState([]);
    const [displayServices, setDisplayServices] = useState([]);

    useEffect(() => {
        fetch('./services.json')
            .then(res => res.json())
            .then(data => {
                setServices(data);
                setDisplayServices(data);
            });
    }, []);

    return (
        <div>
            <section>
                <div className="pb-5">
                    <div className="col-md-12 top-banner">
                        <div className="container">
                            <h1 className="org-title">FEDERAL HEALTH CARE</h1>
                            <p className="org-motto">Better Care and Better Understanding.</p>
                        </div>
                    </div>
                </div>    
            </section>
        </div>
    );
};

export default Home;
